import React from 'react';
import { Row, Col } from 'react-bootstrap';

function Footer() {
  return (
    <Row>
      <Col>
        <div className="navbar navbar-light navbar-expand-md container-fluid">
          Copyright &#169; Arynn Boniface 2020 | Village Watch: New Horizons
        </div>
      </Col>
    </Row>
  )
}

export default Footer;
